// Head component for home page

const Home = () => (
  <div>
    <h1>African Countries</h1>
    <style jsx>{`
      div {
        border-bottom: solid 1px lightgrey;
        padding-top: 2%;
        padding-left: 1%;
        background-color: #ff4d4d;
      }

      h1 {
        display: inline-block;
      }
    `}</style>
  </div>
);

export default Home;
